import React from "react";
import styled from "styled-components";

function Card() {
  const Subject = styled.h3`
    display; block;
    padding: 5px 0;
    font-size: 31px;
    line-height: 1.5;
    `;

  const ButtonWrap = styled.div`
    height: 100%;
    text-align: right;
  `;

  const ModifyBtn = styled.button`
    all: unset;
    padding: 5px 10px;
    font-size: 19px;
    color: #111;
    cursor: pointer;
  `;

  const DeleteBtn = styled.button`
    all: unset;
    padding: 5px 10px;
    font-size: 19px;
    color: #111;
    cursor: pointer;
  `;

  return (
    <>
      <Subject>1</Subject>
      <ButtonWrap>
        <ModifyBtn type="button">수정</ModifyBtn>
        <DeleteBtn type="button">삭제</DeleteBtn>
      </ButtonWrap>
    </>
  );
}

export default Card;
